import { ImQuotesLeft, ImQuotesRight } from "react-icons/im";

function ServicePage1() {
  return (
    <>
      <div></div>
      <div className="flex flex-col justify-center items-center">
        <span className="">
          <ImQuotesLeft size="l" />
        </span>
        <h1>최고의 상속세 전문 세무사 </h1>
        <span className="">
          <ImQuotesRight />
        </span>
      </div>
    </>
  );
}

export default ServicePage1;
